import { Link } from 'react-router-dom';
import LifeSimulationPage from './LifeSimulationPage'; // 假设LifeSimulationPage组件位于同一目录下

function App() {
  return (
    <div>
      <Link to="/life-simulation">Go to Life Simulation Page</Link>
